public long getConfigVersion() throws Exception {
  try (FSDataInputStream in = fileSystem.open(configVersionFile)) {
    return in.readLong();
  } catch (IOException e) {
    LOG.info("Failed to read config version at {}", configVersionFile, e);
    throw e;
  }
}
